import React from "react"


function Popup(props){
    return (props.trigger) ? (
        <div className="popup">
            <div className="popup-inner">
                <button className="close-btn"> Close
                    {props.childern}
                </button>
            </div>
        </div>
    ): "";
}
export default Popup
